        React.createElement("path", { d: "M12 7.75a1.75 1.75 0 110-3.5 1.75 1.75 0 010 3.5z", fill: primaryFill }),
        React.createElement("path", { d: "M12 13.75a1.75 1.75 0 110-3.5 1.75 1.75 0 010 3.5z", fill: primaryFill }),
        React.createElement("path", { d: "M10.25 18a1.75 1.75 0 103.5 0 1.75 1.75 0 00-3.5 0z", fill: primaryFill }));
};
